import styled, { css } from 'styled-components';
import { useEffect, useState } from 'react';

const ORIG_WIDTH = 1200;
const ORIG_HEIGHT = 1680;
const EASING = 'cubic-bezier(0, 0, 0.05, 0.85)';
const DELAY = 100;

const getNum = (x, isWidth) =>
  `${(x / (isWidth ? ORIG_WIDTH : ORIG_HEIGHT)) * 100}%`;

const Container1 = styled.div`
  background: url('data:image/jpeg;base64,');
  position: absolute;
  left: ${getNum(383, true)};
  top: ${getNum(667, false)};
  width: ${getNum(135, true)};
  height: ${getNum(149, false)};
  background-size: 100% 100%;
  perspective: 1;
`;

const Container2 = styled.div`
  background: url('data:image/jpeg;base64,');
  position: absolute;
  left: ${getNum(679, true)};
  top: ${getNum(798, false)};
  width: ${getNum(119, true)};
  height: ${getNum(122, false)};
  background-size: 100% 100%;
  perspective: 1;
`;

const Head1 = styled.div`
  background: url('data:image/png;base64,');
  position: absolute;
  background-size: 100% 100%;
  width: ${getNum(137, true)};
  height: ${getNum(163, false)};
  left: ${getNum(376, true)};
  top: ${getNum(650, false)};
  transition: transform 2000ms ${EASING};
  ${({ $animateIn }) =>
    $animateIn &&
    css`
      transform: rotate(12deg);
    `};
  transform-origin: 60% 80%;
  perspective: 1;
`;

const Head2 = styled.div`
  background: url('data:image/png;base64,');
  position: absolute;
  background-size: 100% 100%;
  width: ${getNum(99, true)};
  height: ${getNum(112, false)};
  left: ${getNum(689, true)};
  top: ${getNum(805, false)};
  transition: transform 2000ms ${EASING};
  ${({ $animateIn }) =>
    $animateIn &&
    css`
      transform: rotate(17deg);
    `};
  transform-origin: 60% 80%;
  perspective: 1;
`;

export const Polygraphia = ({ isActive }) => {
  const [animateIn, setAnimateIn] = useState(false);
  const [timerId, setTimerId] = useState(null);
  const [headNum, setHeadNum] = useState(0);

  useEffect(() => {
    clearTimeout(timerId);

    if (!isActive) {
      setTimeout(() => {
        setAnimateIn(false);
      }, DELAY);
      return;
    }
    setHeadNum(Math.random() > 0.4 ? 0 : 1);
    setTimerId(
      setTimeout(() => {
        setAnimateIn(true);
      }, 1000)
    );
  }, [isActive]);
  return (
    <>
      <Container1 />
      <Container2 />
      <Head1 $animateIn={headNum === 0 && animateIn} />
      <Head2 $animateIn={headNum === 1 && animateIn} />
    </>
  );
};
